message:
Aconteceu algo que eu estava sentindo que iria acontecer: As FFAA estÃO direcionando as manifestações para os poderes políticos.
E olhando friamente, eles não estão errados, alías, estão certos.
Eles não fizeram nada de errado, aliás, não fizeram nada. Nem errado e nem certo, simplesmente nada fizeram.
O que tem que acontecer é a gente assumir o protagonismo da história.
O pedido precisa ser compreensível e inconfundível.

Quando falamos que não queremos esse governo não é FORA LULA, mas sim FORA CHAPA 13;
Quando falamos que não queremos mais ditadura, precisamos dizer: Acabem com o STF - TSE;
Quando falamos que queremos intervenção, precisamos dizer: NOVAS ELEIÇÕES JÁ.

Se só isso for pedido e for aceito, já está de bom tamanho.
Depois temos as pautas não prioritárias como:
- Lula na cadeia;
- Dissolução do Itamaraty;
- Punição de congressistas prevaricadores;
- Revisão das eleições;
etc.,

Se não formos claros nos pedidos, vai ser difícil sermos ouvidos.

